/**
 * Creates a new {@link FieldValueFilter}
 * 
 * @param field
 *          the field to filter
 * @param negate
 *          iff <code>true</code> all documents with no value in the given
 *          field are accepted.
 * 
 */
public FieldValueFilter(String field, boolean negate) {
  this.field = field;
  this.negate = negate;
}

